import React, {Component} from 'react';
import './App.css';
import Cars from "./Cars/Cars";




class App extends Component{



  render() {
    const divStyle={
      textAlign:'center'
    }



    return(
        <div style={divStyle}>

                <nav>
                    <ul>
                        <li><a href="/">Home</a></li>
                        <li><a href="/about">About</a></li>
                    </ul>
                </nav>

           <Cars/>
        </div>
    )

  }
}



export default App;
